async function getSomethingFromMyAPI() {
  try {
    const data = await fetch("http://localhost:3001/ping");
    const json = await data.json();
    console.log("DATA", json);
    return json;
  } catch (error) {
    console.log("ERROR", error);
    throw error;
  }
}

export { getSomethingFromMyAPI };
